import swr from "swr";
import fetch from "isomorphic-unfetch";
import useSWR from "swr";

const fetcher = async (...args) => {
  const res = await fetch(...args);
  return res.json();
};

const Redirect = ({ initialData, apiLink }) => {
  const { data } = useSWR(apiLink, fetcher, { initialData });
  console.log(data);
  return null;
};

Redirect.getInitialProps = async ({ url }) => {
  const apiLink = `http://localhost:3000/redirect/:${url}`;
  const initialData = await fetcher(url);
  return { initialData, apiLink };
};

export default Redirect;
